import React from "react"
import Icons from "icons"

export default function Board(propsPlayer) {
    function icono(){
        if(propsPlayer.player === "player1"){
            <Icons turn="player1"/>
        }else if(propsPlayer.player === "player2"){
            <Icons turn="player2"/>
        }
    };

    return (
        <div class="board">
            <div class="element" onClick={icono}></div>
            <div class="element" onClick={icono}></div>
            <div class="element" onClick={icono}></div>
            <div class="element" onClick={icono}></div>
            <div class="element" onClick={icono}></div>
            <div class="element" onClick={icono}></div>
            <div class="element" onClick={icono}></div>
            <div class="element" onClick={icono}></div>
            <div class="element" onClick={icono}></div>
            <style>
                {`
            .board{
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            grid-template-rows: repeat(3, 1fr); 
            }
            .element{
            width: auto;
            height: 100%;
            cursor: pointer;
            border: 1px solid black;
            margin-top: 100px;
            }
            `}
            </style>
        </div>
    )
}
